// show alert / page
var $pages = document.querySelector('.pages');
var $alerts = document.querySelector('.alerts');

var showAlert = function (selector) {
    var $alert = document.querySelector(selector);
    var $alertBody =  $alert.querySelector('.alert-body');

    $pages.classList.add('pages--blurred');
    $alerts.style.display = 'block';
    TweenMax.fromTo($alert, 0.2, {opacity: 0}, {opacity: 1, display: 'flex'});
    // TweenMax.fromTo($alertBody, 0.4, {scale: 0.2}, {scale: 1, ease: Power2.easeOut});
}

var closeAlert = function (selector) {
    var $alert = document.querySelector(selector);
    var $alertBody =  $alert.querySelector('.alert-body');

    $pages.classList.remove('pages--blurred');
    TweenMax.fromTo($alert, 0.2, {opacity: 1}, {opacity: 0, onComplete: function () {
            $alert.style.display = 'none';
            $alerts.style.display = 'none';
        }});
}

var showPage = function (selector) {
    var $currentPage= null;

    document.querySelectorAll('.page').forEach(($page) => {
        if ($page.style.display != 'none') {
            $currentPage = $page;
        }
    })

    TweenMax.fromTo($currentPage, .5, {x: '0%'}, {x: '-100%', ease: Power0.easeNone, onComplete: function () {
            $currentPage.style.display = 'none';
        }});
    TweenMax.fromTo(selector, 0.3, {x: '100%', zIndex: parseInt($currentPage.style.zIndex)+1}, {x: '0%', display: 'block', ease: Power2.easeOut});
}


var showBottomMenu = function (selector) {
    var $menu = document.querySelector(selector);

    $pages.classList.add('pages--blurred');
    TweenMax.fromTo($menu, 0.2, {y: '100%'}, {y: '0%', display: 'block'});

    $menu.querySelector('.btm-menu-handle').onclick = function() {
        hideBottomMenu(selector);
    }
}


var hideBottomMenu = function (selector) {
    var $menu = document.querySelector(selector);

    $pages.classList.remove('pages--blurred');
    TweenMax.fromTo($menu, 0.2, {y: '0%'}, {y: '100%', display: 'block'});
}
