/**
 * Отрисовка графика
 *
 * @param {string} selector - селектор для родителя в который нужно поместить график
 * @param {boolean} fill - включить отрисовку заливки в графике или нет
 * @param {string} currency - валюта из currencyStatIDs
 * @param {string} period - временной промежуток из
 *
 * example drawGraph('#home-graph-divider-1', true, 'BTC', '24h');
 */
var drawGraph = function (selector, fill, currency, period) {

    // ключ валюты в приходящем json
    var currencyStatIDs = {
        'TMH' : 1,
        'BTC' : 2,
        'ETH' : 3,
        'MHC' : 4
    };

    // элемент в который нужно поместить график
    var $parent = document.querySelector(selector);

    // получим размеры графика в пикселях
    var graphW = $parent.clientWidth,
        graphH = $parent.clientHeight;

    // выбираем данные
    var data = null;
    // 24h
    if (period === '24h') {
        data = currencyStat24h.data[currencyStatIDs[currency]];
    // week
    } else {
        data = currencyStatWeek.data[currencyStatIDs[currency]];
    }

    // x iteration
    var xStep = graphW / data.length;

    // ищем мин и макс значения
    var maxVal = data[0].val,
        minVal = data[0].val;
    for (var j = 0; j < data.length; j++) {
        if (data[j].val > maxVal)
            maxVal = data[j].val;
        if (data[j].val < minVal)
            minVal = data[j].val;
    }

    // расставляем точки на график
    var x = 0;
    var dots = [];
    for (var i = 0; i < data.length; i++) {
        dots.push([x += xStep, graphH - (data[i].val - minVal) / (maxVal - minVal) * graphH]);
    }

    // рисуем svg внутренности
    var rndID = parseInt(Math.random() * 1000000);
    var html = '';
    html += '<svg class="currency-graph-svg" width="' + graphW + '" height="' + graphH + '" viewBox="0 0 ' + graphW + ' ' + graphH + '" fill="none" xmlns="http://www.w3.org/2000/svg">'
    if (fill === true) {
        html += '<path d="M' + dots.join(' L') + ' L' + graphW + ',' + graphH + ' L' + 0 + ',' + graphH + '" fill="url(#paint' + rndID + '_bg)" />';
    }
    html += '<path d="M' + dots.join(' L') + '" stroke="url(#paint' + rndID + '_linear)" stroke-linecap="round" stroke-linejoin="round" fill="none"/>';
    html += '<defs>';
    if (fill === true) {
        html += '<linearGradient id="paint' + rndID + '_bg" x1="' + (graphW / 2) + '" y1="0" x2="' + (graphW / 2) + '" y2="' + graphH + '" gradientUnits="userSpaceOnUse">';
        html +=   '<stop stop-color="#81BEF7" stop-opacity="0.4"></stop>';
        html +=   '<stop offset="1" stop-color="#2F7BC2" stop-opacity="0"></stop>';
        html += '</linearGradient>';
        html += '<linearGradient id="paint' + rndID + '_linear" x1="' + (0.89 * graphW) + '" y1="' + (0.69 * graphH) + '" x2="' + (0.89 * graphW) + '" y2="1" gradientUnits="userSpaceOnUse">';
        html +=   '<stop stop-color="#81BEF7"></stop>';
        html +=   '<stop offset="1" stop-color="#04D67E"></stop>';
        html += '</linearGradient>';
    } else {
        html += '<linearGradient id="paint' + rndID + '_linear" x1="0" y1="' + (0.75 * graphH) + '" x2="' + graphW + '" y2="' + (0.3 * graphH) + '" gradientUnits="userSpaceOnUse">';
        html +=   '<stop stop-color="#093360"/>';
        html +=   '<stop offset="0.111278" stop-color="#0F4E88"/>';
        html +=   '<stop offset="0.948653" stop-color="#04D67E"/>';
        html +=   '<stop offset="1" stop-color="#09335E"/>';
        html += '</linearGradient>';
    }
    html += '</defs>';
    html += '</svg>';

    $parent.innerHTML = html;
};


