// draggable sliding elements
var makeDraggableCards = function (parentSelector, selector, underItemSelector) {
    var $cardsWrapper = document.querySelectorAll(parentSelector);

    $cardsWrapper.forEach(($cardWrapper) => {
        var $undermenuItems = $cardWrapper.querySelectorAll(underItemSelector);
        var $undermenuItemsLength = $undermenuItems.length;

        // если есть под карточкой скрытые подменю то инитим драг
        if ($undermenuItemsLength > 0) {
            var w = 76;

            var $card = $cardWrapper.querySelector(selector);
            Draggable.create($card, {
                type: "x",
                edgeResistance: 1,
                minimumMovement: 10,
                throwProps: true,
                bounds:{ minX: 0, maxX: $undermenuItemsLength * w},
                // onDrag: function() {
                //     $cardWrapper.querySelector('.transactions-log-card-under').style.width = this.x;
                // },
                onDragEnd: function() {
                    if (this.endX !== 0 && this.endX !== $undermenuItemsLength * w) {
                        TweenMax.to(this.target, 0.2, {x: this.endX < $undermenuItemsLength * w / 2 ? 0 : $undermenuItemsLength * w});
                    }

                    if (this.target.querySelector('.icon-arrow-slide-right')) {
                        if (this.endX < $undermenuItemsLength * w / 2) {
                            this.target.querySelector('.icon-arrow-slide-right').classList.remove('mirror');
                        } else {
                            this.target.querySelector('.icon-arrow-slide-right').classList.add('mirror');
                        }
                    }
                }
            });
        }
    })
};

